import React from 'react';
import './Header.css';

import {Nav} from 'react-bootstrap';

class Header extends React.Component {
  render() {
    return (
    	<div className="header">
	    	<h1 className="header_title">The Liu Family's Home Videos</h1>
	    	<p className="header_description">A collection of the Liu family's home videos throughout the years</p>   
	    	<Nav variant="pills">
		    	{
		          this.props.categoryNames.map(videoCategory => {
		            return <Nav.Item><Nav.Link eventKey="link-1">{videoCategory}</Nav.Link></Nav.Item>
		          })
		        }
			  <Nav.Item>
			    <Nav.Link href="/home">Active</Nav.Link>
			  </Nav.Item>
			  <Nav.Item>
			    <Nav.Link eventKey="link-1">Option 2</Nav.Link>
			  </Nav.Item>
			</Nav>
    	</div>
    );
  }
}

export default Header;
